import styled from "styled-components";

export const SearchDiv = styled.div`padding-bottom: 50% ;
background-color:white;`;

export const PopupDiv = styled.div`position:fixed;
                                background-color:rgba(0,0,0,0.5);
                                left:0;
                                right:0;
                                width:100%;
                                height:100vh;`;

export const PopupContent = styled.div`position:relative;
background-color:rgba(0,0,0,0.5);
width:50%;
min-height:300px;
background-color:#FFF;
padding:20px;
overflow:auto;`;
